class Solution:
    def leadsToDestination(self, n: int, edges: list[list[int]], source: int, destination: int) -> bool:
        
        def dfs(start, lvl):

            #print("start=", start, "lvl=", lvl)

            if lvl>n: return False
            if not map[start]: return False

            for tgt in map[start]:
                if tgt != destination:
                    r = dfs(tgt, lvl+1)
                    if not r: return False

            return True


        if n == 1 and not edges and source == destination: return True

        map = [[] for _ in range(n)]
        for e in edges:
            map[e[0]].append(e[1])
        #var_dump(map)
        
        for i in range(n):
            if not map[i] and i!=destination: return False

        if map[destination]: return False

        return dfs(source, 1)


class Solution2:

    GRAY = 1
    BLACK = 2

    def leadsToDestination(self, n: int, edges: list[list[int]], source: int, destination: int) -> bool:
        
        def dfs(start):

            #print("start=", start)

            if states[start] != None: return states[start] == self.BLACK

            if not map[start]: return False

            states[start] = self.GRAY
            for tgt in map[start]:
                if tgt != destination:
                    if not dfs(tgt): return False

            states[start] = self.BLACK
            return True


        if n == 1 and not edges and source == destination: return True

        map = [[] for _ in range(n)]
        for e in edges:
            map[e[0]].append(e[1])
        #var_dump(map)
        
        if map[destination]: return False

        states = [None] * n

        return dfs(source)


